import './Moviecard.css'

function Moviescard(probs) {
    return (
        <div>
            <p>{probs.title}</p>
            <p>{probs.year}</p>
            <p>{probs.director}</p>
            <p>{probs.duration}</p>
            <p>{probs.genre}</p>
            <p>{probs.rate}</p>
        </div>
    )
}

export default Moviescard;
